import React, { useEffect, useState } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { registerUser } from '../store/AuthSlice'
import { StyleFrom } from '../style/StyleForm'
import { useNavigate } from 'react-router'
import { toast } from 'react-toastify'

function Register() {

    const dispatch = useDispatch()
    const auth = useSelector((state)=>state.auth)
    const navigate = useNavigate()

    useEffect(()=>{
      if(auth._id){
        navigate("/home")
      }
    },[auth._id, navigate])

    const [user,setUser] = useState({
        name:"",
        email:"",
        password:""
    })


    const handleSubmit = (e)=>{
            e.preventDefault()
            dispatch(registerUser(user))
    }


  return (
    <>

    <StyleFrom  onSubmit={handleSubmit}>
        <h2>Register</h2>
        <input type='text' name='' placeholder='Name' onChange={(e)=>setUser({...user, name:e.target.value})}/>
        <input type='email' name='' placeholder='Email' onChange={(e)=>setUser({...user, email:e.target.value})}/>
        <input type='password' name='' autoComplete="on" placeholder='Password' onChange={(e)=>setUser({...user, password:e.target.value})}/>
        <button>
          {auth.registerStatus === "pending" ? "submitting" : "Register"}
        </button>

        { auth.registerStatus ===  "rejected" ? toast.warn( <p>{auth.registerError}</p>,{pos} ): null}
    </StyleFrom>

    </>
  )
}

export default Register
